   "description": "Karl-Axel Efraim Fried was a Swedish dentist and dental inspector from Jönköping. He was born on August 12, 1887, to Axel Theodor F. and Helén Holm in Jönköping and graduated from Jönköping High School in 1908. He completed his dental studies in 1912 and worked as a dentist in Gothenburg and Jönköping. He served as the head of the dental hygiene department in Jönköping and Småland county and as a dental inspector in Jönköping. He was a board member and chairman of Småland Dental Association and Jönköping Dental Association, respectively. He was also a member of the police board, represented the city in the Association for Physical Education, and served as a board member and chairman of Småland Sports Association and Jönköping Athletic Club. He had a hobby of playing tennis and received several awards and recognitions, including the Order of Vasa, the Swedish Sports Confederation's Gold Medal, and Småland Sports Association's Diploma of Merit."
